import Header from "../Header/Header";
import Products from "../Catalog/Catalog";
import MobileNavBar from '../MobileNavBar/MobileNavBar';

export default function MainPage({ onCardClick, onLikeClick, products, savedProducts, isLoggedIn, terms, onCatClick, category, onBurgerClick, onBurgerClose, isBurgerOpen, search, setSearch }) {
  return(
    <>
    <Products
    onCardClick={onCardClick}
    onLikeClick={onLikeClick}
    products={products}
    savedProducts={savedProducts}/>
    <MobileNavBar
      onBurger={onBurgerClick} 
      isBurgerOpen={isBurgerOpen} 
      onBurgerClose={onBurgerClose}
    />
    </>
  )
}
